import * as Styled from './styles'

import { useProtectedPage } from '../../hooks/useProtectedPage'
import { Header } from '../../components/Header'

export const Dashboard = () => {
  useProtectedPage()

  return (
    <Styled.Dashboard>
      <Header />
      <Styled.SessionData>Sessão</Styled.SessionData>
      <Styled.Documentation>Documentação</Styled.Documentation>
    </Styled.Dashboard>
  )
}
